import React from 'react';
import styles from '../../styles/forecast-table.module.scss';
import { HourlyForecastDisplay } from '../../store/types';
import { TempDisplay } from '../TempDisplay';

type ForecastTableProps = {
	todayForecast: HourlyForecastDisplay[];
};

export const ForecastTable: React.FC<ForecastTableProps> = ({
	todayForecast,
}) => (
	<table className={styles.forecastTable}>
		<thead>
			<tr className={styles.header}>
				<th>Time</th>
				<th>Temp</th>
				<th>Weather</th>
				<th>Alerts</th>
			</tr>
		</thead>
		<tbody>
			{todayForecast.map((tf, index) => (
				<tr key={index} className={styles.body}>
					<td>{tf.time}</td>
					<td>
						<TempDisplay temp={tf.temp} />
					</td>
					<td className={styles.bodyImage}>
						<img src={tf.icon} alt={`${tf.main} icon`} />
						<span>{tf.main}</span>
					</td>
				</tr>
			))}
		</tbody>
	</table>
);
